      SELECT ALL + + col1 + CAST ( + col1 AS INTEGER ) - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NULL ) NOT BETWEEN NULL AND + + 32 + - 4 + col1 * col2;
  - name: tab2

outputs:
  - name: q9959.out
    data: |
